import React from "react";
import Layout from "../../../Common/Component/Layout";
import mainImg from "../../../Image/event7result.png";
import "./index.scss";

export default function View(props) {
  return (
    <Layout>
      <div className="eventEnd7">
        <img className="ev7ResultImg" src={mainImg} alt="result" />
      </div>
    </Layout>
  );
}
